pragma solidity ^0.4.24;
import "../../node_modules/openzeppelin-solidity/contracts/math/SafeMath.sol";

import "../SharedContracts/VuupleAdmins.sol";
import "./RenterFiles.sol";
import "./RenterEscrow.sol";
import "../SharedContracts/VuupleToken.sol";
import "../SharedContracts/DateTimeParser.sol";

contract RenterRegistration is DateTimeParser {
    using SafeMath for uint256;

    address public contractOwner;
    VuupleAdmins private vuupleAdmin;
    RenterFiles private renterFiles;
    VuupleToken private vuupleToken;
    RenterEscrow public escrow;


    enum MembershipType { Org, Individual }
    enum Status { ready, pending }

    MembershipType public membershipType;
    uint256 public renewalDate; // this date stores the renewal date and expire after 30 days
    uint256 public registerDate;
    uint256 public renteredStorage;               // we will set list of storage tiers  in Giga 
    uint256 public usedStorage =0;  // in Byte 
    uint256 public tokenAmount ;  
    Status public currentStatus = Status.pending;  
    bool public active =true;
    bool public banned =false;

    // uint16  year;
    // uint8   month ;
    // uint8  day ;
    // uint8  hour ; 
    // uint8  minute ;
    modifier isOwner {
        require(contractOwner == msg.sender);
        _;
    }    
    modifier onlyVuupleAdmin() {
        require(vuupleAdmin.isVuupleAdmin(msg.sender));
        _;
    }
    modifier onlyAdminOrOwner() {
        require(vuupleAdmin.isVuupleAdmin(msg.sender) || contractOwner == msg.sender);
        _;
    }

    modifier subscriptionEnded() {
        require( block.timestamp > renewalDate);
        _;
    }
    modifier subscriptionNotEnded() {
        require( renewalDate >= block.timestamp);
        _;
    }
    modifier subscriptionNew() {
        require( renewalDate==0);
        _;
    }
    modifier unbanned() {
        require( !banned);
        _;
    }
    modifier isActive() {
        require( active);
        _;
    }
    modifier isReady() {
        require( currentStatus==Status.ready);
        _;
    }

    constructor (uint256 _type, VuupleAdmins _adminAddress, VuupleToken _vuupleToken , address _sender) public {            

        contractOwner = _sender;
        vuupleAdmin = _adminAddress;
        vuupleToken = _vuupleToken;
        registerDate = block.timestamp;

        require(uint(MembershipType.Individual)==_type ||uint(MembershipType.Org)==_type );




        if(uint(MembershipType.Individual)==_type){
            membershipType =MembershipType.Individual ;
            // require( _vuupleToken.balanceOf(msg.sender)>);
            renteredStorage=5;
            tokenAmount = renteredStorage.mul(4);

        }else if (uint(MembershipType.Org)==_type){
            membershipType =MembershipType.Org ;
            renteredStorage=10;
            tokenAmount=renteredStorage.mul(3);
        }
    //   require( _vuupleToken.balanceOf(msg.sender)>= tokenAmount);
     //  _issueRenterFilecontract();

     //vuupleToken.transfer(escrow, tokenAmount);
        } 
    // check that the last subscription is ended
    // we need to rewrite this code to suuport renewal suppscription and to match the whitepaper logic 
    function renewSubscription (uint256 _renteredStorage ) public isOwner subscriptionEnded unbanned returns(bool){     // enter amount in GB





        renteredStorage = _renteredStorage;
            if(MembershipType.Individual==membershipType){

            tokenAmount = renteredStorage.mul(4);

        }else if (MembershipType.Org==membershipType){

            tokenAmount=renteredStorage.mul(3);
        }
        currentStatus = Status.pending;  
        renewalDate =0;
        if(!active){
            active=true;

        }
          return true;

    }

    function addFileToStorage (string _bzzHash,
        string _fileName,
        uint256 _size) public isOwner/* subscriptionNotEnded*/  unbanned isActive isReady returns(bool) {
        require(usedStorage +_size <= renteredStorage);
        usedStorage += _size;
        renterFiles.addFile( _bzzHash,
        _fileName,
        _size);
        return true;

    }
    // function addEncryptedFileToStorage (string _bzzHash,
    //     string _fileName,
    //     uint256 _size,
    //     string _fileType,
    //     uint256 _bzzSchema,
    //     bool _isEncrypted,
    //     string _encryptedKey) public isOwner subscriptionNotEnded unbanned isActive isReady returns(bool) {
    //     require(usedStorage +_size <= renteredStorage);
    //     usedStorage += _size;
    //     renterFiles.addFile( _bzzHash,
    //     _fileName,
    //     _size,
    //     _fileType,
    //     _bzzSchema,
    //     _isEncrypted,
    //     _encryptedKey);
    //     return true;

    // }


    function completeSubscription()isOwner subscriptionNew returns(bool)  {
        require( vuupleToken.balanceOf(this)>= tokenAmount);
        renewalDate = now + 30 days; //block.timestamp + 2592000;// add 30 days just to avoid quorum issue _getRenewalDate();
        _issueRenterFilecontract(); 
         escrow = new RenterEscrow( vuupleAdmin,vuupleToken ,renewalDate,tokenAmount,contractOwner);
         vuupleToken.transfer(escrow,tokenAmount);
         currentStatus=Status.ready;
          return true;
    }

    function getBalance() public view isOwner returns (uint) {
        return vuupleToken.balanceOf(this) ;
    }

    function setActiveStatus(bool status) public isOwner unbanned returns(bool) {
        active = status;
        renewalDate =0;
        if(!status){
            renterFiles.destroy();
            if(escrow.isActive()){
            require(escrow.closeEscrow());

        }
        }else{
            // weird bug , it fails when call this function only here and on setBanStatus function 
     _issueRenterFilecontract(); 
        }

        // TODO : set contract address to equivalent  null value in solidity 
        // renterFiles=address(0);

        return true;

    }

    function setBanStatus(bool status) public onlyVuupleAdmin returns(bool) {
        banned = status;
        active = !status;

         active = status;
        renewalDate =0;
        if(status){
            renterFiles.destroy();
            if(escrow.isActive()){
            require(escrow.closeEscrow());

        }
        }else{
     _issueRenterFilecontract(); 
        }

        // TODO : set contract address to equivalent  null value in solidity 
        // renterFiles=address(0);

        return true;
    }
function getRenterFiles() onlyAdminOrOwner returns (RenterFiles) {
    return renterFiles;
}
    function _issueRenterFilecontract() internal {
        renterFiles = new RenterFiles(contractOwner);
    }
//     function getTimeNow() public returns (uint) {
//     return block.timestamp;
// }

}
